import React from 'react';

function AddToDo() {
    const styles = {
        form: {
            display: 'flex',
            justifyContent: 'center'
        },
        input: {
            width: '20rem',
            height: '1.5rem',
            margin: '0 0 0 '
        }
    }
    return (
        <form style={styles.form} action="">
            <input style={styles.input} type="text" />
            <button className='btn' type='submit'>Add ToDo</button>
        </form>
    )
}
export default AddToDo;
